import React, {useState} from 'react'
import "../styles/formproduct.css";
import { useForm } from 'react-hook-form';
import ListeChocolats from "../pages/pageficheproduitjson";
import { title } from 'node-openssl-cert/name_mappings';




export default function Formproduct() {

    const products = [
        { id: 1,
         title: "Cerisier",
        price: 2.99,
        note : 5, },

      ];

      const [filteredProducts, setFilteredProducts] = useState([]);

      const filterProducts = (id) => {
        const filtered = products.filter(id => products.id === id);
        setFilteredProducts(filtered);
      } 

    return (
     <>

     <div className="containerForm">
     <h4>Filtre </h4>  
     <div className="categoriepanel">
    <label className="categ" htmlFor="category">Catégories</label><br/><br/>
    <input type="checkbox" id="PresentPanelForm" name="all" value="product"/>
    <label for="vehicle1"> Tous</label><br/>
    <input type="checkbox" id="Panel1form" name="ChocolatBlanc" value="product"/>
    <label for="vehicle2" onClick={() => filterProducts('Blanc')}> Chocolat Blanc</label><br/>
    <input type="checkbox" id="Panel2form" name="ChocolatauLait" value="product"/>
    <label for="vehicle3"> Chocolat au Lait</label><br/>
    <input type="checkbox" id="Panel3form" name="ChocolatNoir" value="product"/>
    <label for="vehicle3"> Chocolat noir</label> <br/>
    <input type="checkbox" id="Panel4form" name="Fruit" value="Boat"/>
    <label for="vehicle3"> Fruit</label> <br/>
    <input type="checkbox" id="Panel5form" name="Caramel" value="Boat"/>
    <label for="vehicle3"> Caramel</label> <br/>
    <input type="checkbox" id="Panel6form" name="Liqueur" value="Boat"/>
    <label for="vehicle3"> Liqueur</label> <br/><br/>
    </div>

    <div className="prixpanel">
    <label className="prix" htmlFor="price">Prix</label><br/><br/> 
    <label for="Prix min">Prix min &nbsp; </label>
     <input type="number" id="quantity" name="quantity" min="1" max="100"placeholder="1€"/><br/><br/>
     <label for="Prix min">Prix Max &nbsp; </label>
     <input type="number" id="quantity" name="quantity" min="100" max="200" placeholder="100€"/><br/><br/>

     <label htmlFor="Username">Notes</label><br/><br/>
    <label for="Prix min">Note min &nbsp; </label>
     <input type="number" id="quantity" name="quantity" min="1" max="5"placeholder="1"/><br/><br/>
     <label for="Prix min">Note Max &nbsp; </label>
     <input type="number" id="quantity" name="quantity" min="1" max="5" placeholder="5"/><br/><br/>
     </div>

   
     </div>

{/* Affichage des produits filtrés */}

<ul>
      {filteredProducts.map(id => (
        <li key={products.id}>
          {products.title} - {products.price}€
        </li>
      ))}
    </ul>
      </>
    );
  }
